import util.trace.port.rpc.rmi.RMITraceUtility;

import java.rmi.NotBoundException;
import java.rmi.RemoteException;
import java.rmi.registry.LocateRegistry;
import java.rmi.registry.Registry;
import java.rmi.server.UnicastRemoteObject;
import java.util.ArrayList;
import java.util.List;

@Tags({DistributedTags.SERVER, DistributedTags.RMI})
public class RMIServer extends AnAbstractSimulationParametersBean implements ServerInterface, RMIServerInterface {
    private static ServerInterface serverInstance = new RMIServer();
    private List<RMIClientInterface> registeredRMIClients;
    private Registry rmiRegistry;

    RMIServer() {
        this.registeredRMIClients = new ArrayList<>();
    }

    public static ServerInterface getSingleton() {
        return serverInstance;
    }

    @Override
    public void quit(int aCode) {
        System.exit(aCode);
    }

    @Override
    public void setTracing() {
        FactoryTraceUtility.setTracing();
        RMITraceUtility.setTracing();
        ConsensusTraceUtility.setTracing();
        NIOTraceUtility.setTracing();
        ThreadDelayed.enablePrint();
        this.trace(true);
    }

    @Override
    public void locateRegistry(int registryPort, String registryHost) throws RemoteException {
        this.rmiRegistry = LocateRegistry.getRegistry(registryPort);
        RMIRegistryLocated.newCase(this, registryHost, registryPort, this.rmiRegistry);
    }

    @Override
    public void exportServerProxy(int rmiServerPort) throws RemoteException {
        UnicastRemoteObject.exportObject(this, rmiServerPort);
        this.rmiRegistry.rebind(RMIServerInterface.class.getName(), this);
        RMIObjectRegistered.newCase(this, RMIServerInterface.class.getName(), this, this.rmiRegistry);
    }

    @Override
    public void registerRMIClients() {
        try {
            RMIClientInterface clientProxy = (RMIClientInterface) this.rmiRegistry.lookup(RMIClientInterface.class.getName());
            RMIObjectLookedUp.newCase(this, clientProxy, RMIClientInterface.class.getName(), this.rmiRegistry);
            this.registeredRMIClients.add(clientProxy);
        } catch (RemoteException | NotBoundException ex) {
            ex.printStackTrace();
        }
    }

    protected void receiveRequestViaRMI(String anObjectName, Object aProposal, RMIClientInterface currentClientProxy) {
        try {
            RemoteProposeRequestReceived.newCase(this, anObjectName, -1, aProposal);
            for (RMIClientInterface otherClientProxy : this.registeredRMIClients) {
                if (!otherClientProxy.equals(currentClientProxy)) {
                    ProposalLearnedNotificationSent.newCase(this, CommunicationStateNames.BROADCAST_MODE, -1, anObjectName);
                    otherClientProxy.receiveProposalLearnedNotificationViaRMI(anObjectName, aProposal);
                }
            }
        } catch (RemoteException ex) {
            ex.printStackTrace();
        }
    }

    @Override
    public void receiveCommandViaRMI(String aCommand, RMIClientInterface clientProxy) {
        this.receiveRequestViaRMI(CommunicationStateNames.COMMAND, aCommand, clientProxy);
    }

    @Override
    public void receiveIPCMechanismViaRMI(IPCMechanism ipcMechanism, RMIClientInterface clientProxy) {
        this.receiveRequestViaRMI(CommunicationStateNames.IPC_MECHANISM, ipcMechanism, clientProxy);
    }

    protected void init(String[] args) {
        try {
            this.setTracing();
            int rmiRegistryPort = ServerArgsProcessor.getRegistryPort(args), rmiServerPort = ServerArgsProcessor.getServerPort(args);
            String registryHost = ServerArgsProcessor.getRegistryHost(args);
            this.locateRegistry(rmiRegistryPort, registryHost);
            this.exportServerProxy(rmiServerPort);
        } catch (RemoteException ex) {
            ex.printStackTrace();
        }
    }

    @Override
    public void start(String[] args) {
        this.init(args);
        SimulationParametersControllerFactory.getSingleton().addSimulationParameterListener(this);
        SimulationParametersControllerFactory.getSingleton().processCommands();
    }

    public static void main(String[] args) {
        ServerInterface serverInstance = getSingleton();
        serverInstance.start(args);
    }
}

